s://datacatalog.worldbank.org/public-licenses#cc-by"],"WDITable",["^ ","^3","atom","^4","4.9"],"decimal",["^ ","^3","atom","^4",0],"description",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","Topic","Economic Policy & Debt: National accounts: US$ at constant 2015 prices: Expenditure on GDP","Statisticalconceptandmethodology","Gross domestic product (GDP) from the expenditure side is made up of household final consumption expenditure, general government final consumption expenditure, gross capital formation (private and public investment in fixed assets, changes in inventories, and net acquisitions of valuables), and net exports (exports minus imports) of goods and services. Such expenditures are recorded in purchaser prices and include net taxes on products.","Aggregationmethod","Gap-filled total","Periodicity","Annual","BasePeriod","2015","Developmentrelevance","An economy's growth is measured by the change in the volume of its output or in the real incomes of its residents. The 2008 United Nations System of National Accounts (2008 SNA) offers three plausible indicators for calculating growth: the volume of gross domestic product (GDP), real gross domestic income, and real gross national income. The volume of GDP is the sum of value added, measured at constant prices, by households, government, and industries operating in the economy. GDP accounts for all domestic production, regardless of whether the income accrues to domestic or foreign institutions.","Source","World Bank national accounts data, and OECD National Accounts data files.","Longdefinition","Exports of goods and services represent the value of all goods and other market services provided to the rest of the world. They include the value of merchandise, freight, insurance, transport, travel, royalties, license fees, and other services, such as communication, construction, financial, information, business, personal, and government services. They exclude compensation of employees and investment income (formerly called factor services) and transfer payments. Data are in constant 2015 prices, expressed in U.S. dollars.","^11","https://datacatalog.worldbank.org/public-licenses#cc-by","sourceNote","Exports of goods and services represent the value of all goods and other market services provided to the rest of the world. They include the value of merchandise, freight, insurance, transport, travel, royalties, license fees, and other services, such as communication, construction, financial, information, business, personal, and government services. They exclude compensation of employees and investment income (formerly called factor services) and transfer payments. Data are in constant 2015 prices, expressed in U.S. dollars.","^10","CC BY-4.0","Limitationsandexceptions","Because policymakers have tended to focus on fostering the growth of output, and because data on production are easier to collect than data on spending, many countries generate their primary estimate of GDP using the production approach. Moreover, many countries do not estimate all the components of national expenditures but instead derive some of the main aggregates indirectly using GDP (based on the production approach) as the control total.\n\nData on exports and imports are compiled from customs reports and balance of payments data. Although the data from the payments side provide reasonably reliable records of cross-border transactions, they may not adhere strictly to the appropriate definitions of valuation and timing used in the balance of payments or corresponds to the change-of ownership criterion. This issue has assumed greater significance with the increasing globalization of international business. Neither customs nor balance of payments data usually capture the illegal transactions that occur in many countries. Goods carried by travelers across borders in legal but unreported shuttle trade may further distort trade statistics.","shortname","Exports of goods and services","sourceOrganizatio ank.org/public-licenses#cc-by"],"^12",["^ ","^3","atom"],"^13",["^ ","^3","atom","^4",0],"^14",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^18","Annual","^15","Economic Policy & Debt: National accounts: Local currency at current prices: Expenditure on GDP","^1;","World Bank national accounts data, and OECD National Accounts data files.","^1<","Gross capital formation (formerly gross domestic investment) consists of outlays on additions to the fixed assets of the economy plus net changes in the level of inventories. Fixed assets include land improvements (fences, ditches, drains, and so on); plant, machinery, and equipment purchases; and the construction of roads, railways, and the like, including schools, offices, hospitals, private residential dwellings, and commercial and industrial buildings. Inventories are stocks of goods held by firms to meet temporary or unexpected fluctuations in production or sales, and \"work in progress.\" According to the 1993 SNA, net acquisitions of valuables are also considered capital formation. Data are in current local currency.","^11","https://datacatalog.worldbank.org/public-licenses#cc-by","^1=","Gross capital formation (formerly gross domestic investment) consists of outlays on additions to the fixed assets of the economy plus net changes in the level of inventories. Fixed assets include land improvements (fences, ditches, drains, and so on); plant, machinery, and equipment purchases; and the construction of roads, railways, and the like, including schools, offices, hospitals, private residential dwellings, and commercial and industrial buildings. Inventories are stocks of goods held by firms to meet temporary or unexpected fluctuations in production or sales, and \"work in progress.\" According to the 1993 SNA, net acquisitions of valuables are also considered capital formation. Data are in current local currency.","^10","CC BY-4.0","^1A","Gross capital formation (current LCU)","^1@","World Bank national accounts data, and OECD National Accounts data files.","^1?","Gross capital formation","^1B","Gross capital formation (current LCU)"]],"^1A",["^ ","^3","atom","^4","Gross capital formation (current LCU)"],"id",["^ ","^3","atom","^4","NE.GDI.TOTL.CN"],"^1C",["^ ","^3","atom","^4",[2023,["KG","CR","NA","MY","DE","SE","CZ","LY","AR","CD","IN","RW","LT","SN","KM","BI","MT","BW","ME","AT","BO","PS","NE","PH","AO","GE","CA","MG","NP","RO","MH","BN","JP","HR","LU","UA","GT","EE","SG","TL","AZ","SV","PL","KE","XK","GH","CN","AL","LV","AU","KH","UY","MO","BF","TD","MV","IL","BH","NZ","AM","IE","UZ","ZW","PY","MD","GR","ID","MA","CF","SD","CO","LS","PR","ZM","GN","BD","VN","DJ","SI","GB","BR","RS","HN","ES","SK","BA","GW","NI","FI","PK","CY","DZ","BY","BG","BE","HK","ML","MX","ET","MR","CM","FO","SA","CL","BM","SO","PE","TG","NL","AW","AF","CH","CG","KZ","MU","CV","PT","TN","SC","GM","EC","TZ","SL","GQ","BS","TH","GA","HT","PA","CI","FR","RU","TR","NO","BZ","BJ","US","UG","EG","HU","KR","MZ","DK","AE","WS","MK","MN","IS","IT","LK","DO","ZA"]]],"^1D",["^ ","^3","atom","^4",["NE.GDI.TOTL.CD","NE.GDI.TOTL.KD.ZG","NE.GDI.TOTL.KD","NE.GDI.TOTL.KN","NE.GDI.TOTL.ZS","NE.GDI.FTOT.CN","NE.GDI.FTOT.CD","NE.GDI.FTOT.KD.ZG","NE.GDI.FPRV.ZS"]],"^1?",["^ ","^3","atom","^4","Gross capital formation"],"^1E",["^ ","^3","atom","^4","2"],"^1=",["^ ","^3","atom","^4","Gross capital formation (formerly gross domestic investment) consists of outlays on additions to the fixed assets of the economy plus net changes in the level of inventories. Fixed assets include land improvements (fences, ditches, drains, and so on); plant, machinery, and equipment purchases; and the construction of roads, railways, and the like, including schools, offices, hospitals, private residential dwellings, and commercial and industrial buildings. Inventories are stocks of goods held by firms to meet temporary or unexpected fluctuations in production or sales, and \"work in progress.\" According to the 1993 SNA, net acquisitions of valuables are also considered capital formation. Data are in current local currency."],"^1@",["^ ","^3","atom","^4","World Bank national accounts data, and OECD National Accounts data files."],"^1F",["^ ","^3","atom"],"^1G",["^ ","^3","atom","^4",[["^ ","id","3","^4","Economy & Growth"]]],"^1H",["^ ","^3","atom","^4","unknown"]],"NE.GDI.TOTL.CD",["^ ","^10",["^ ","^3","atom","^4","CC BY-4.0"],"^11",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^12",["^ ","^3","atom"],"^13",["^ ","^3","atom","^4",0],"^14",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^16","Gross domestic product (GDP) from the expenditure side is made up of household final consumption expenditure, general government final consumption expenditure, gross capital formation (private and public investment in fixed assets, changes in inventories, and net acquisitions of valuables), and net exports (exports minus imports) of goods and services. Such expenditures are recorded in purchaser prices and include net taxes on products.","^17","Gap-filled total","^18","Annual","^15","Economic Policy & Debt: National accounts: US$ at current prices: Expenditure on GDP","^1;","World Bank national accounts data, and OECD National Accounts data files.","^1<","Gross capital formation (formerly gross domestic investment) consists of outlays on additions to the fixed assets of the economy plus net changes in the level of inventories. Fixed assets include land improvements (fences, ditches, drains, and so on); plant, machinery, and equipment purchases; and the construction of roads, railways, and the like, including schools, offices, hospitals, private residential dwellings, and commercial and industrial buildings. Inventories are stocks of goods held by firms to meet temporary or unexpected fluctuations in production or sales, and \"work in progress.\" According to the 1993 SNA, net acquisitions of valuables are also considered capital formation. Data are in current U.S. dollars.","^11","https://datacatalog.worldbank.org/public-licenses#cc-by","^1=","Gross capital formation (formerly gross domestic investment) consists of outlays on additions to the fixed assets of the economy plus net changes in the level of inventories. Fixed assets include land improvements (fences, ditches, drains, and so on); plant, machinery, and equipment purchases; and the construction of roads, railways, and the like, including schools, offices, hospitals, private residential dwellings, and commercial and industrial buildings. Inventories are stocks of goods held by firms to meet temporary or unexpected fluctuations in production or sales, and \"work in progress.\" According to the 1993 SNA, net acquisitions of valuables are also considered capital formation. Data are in current U.S. dollars.","^10","CC BY-4.0","^1>","Because policymakers have tended to focus on fostering the growth of output, and because data on production are easier to collect than data on spending, many countries generate their primary estimate of GDP using the production approach. Moreover, many countries do not estimate all the components of national expenditures but instead derive some of the main aggregates indirectly using GDP (based on the production approach) as the control total.\n\nData on capital formation may be estimated from direct surveys of enterprises and administrative records or based on the commodity flow method using data from production, trade, and construction activities. The quality of data on government fixed capital formation depends on the quality of government accounting systems (which tend to be weak in developing countries). Measures of fixed capital formation by households and corporations - particularly capital outlays by small, unincorporated enterprises - are usually unreliable.\n\nEstimates of changes in inventories are rarely complete but usually include the most important activities or commodities. In some countries these estimates are derived as a composite residual along with household final consumption expenditure. According to national accounts conventions, adjustments should be made for appreciation of the value of inventory holdings due to price changes, but this is not always done. In highly inflationary economies this element can be substantial.","^1A","Gross capital formation (current US$)","^1@","World Bank national accounts data, and OECD National Accounts data files.","^1?","Gross capital formation","^1B","Gross capital formation (current US$)"]],"^1A",["^ ","^3","atom","^4","Gross capital formation (current US$)"],"id",["^ ","^3","atom","^4","NE.GDI.TOTL.CD"],"^1C",["^ ","^3","atom","^4",[2023,["KG","CR","NA","MY","DE","SE","CZ","LY","AR","CD","IN","RW","LT","SN","KM","BI","MT","BW","ME","AT","BO","PS","NE","PH","AO","GE","CA","MG","NP","RO","MH","BN","JP","HR","LU","UA","GT","EE","ZT","SG","TL","AZ","SV","PL","KE","XK","GH","CN","AL","LV","AU","KH","UY","T4","MO","BF","TD","MV","IL","BH","NZ","AM","IE","UZ","ZW","PY","MD","GR","ID","MA","T7","CF","SD","CO","T2","LS","PR","ZM","GN","BD","VN","DJ","SI","GB","BR","RS","HN","ES","SK","BA","GW","NI","FI","PK","CY","DZ","BY","BG","T5","BE","HK","ML","MX","ET","MR","CM","FO","SA","CL","BM","SO","PE","TG","NL","AW","AF","CH","CG","KZ","MU","CV","PT","TN","SC","GM","T6","EC","TZ","SL","GQ","BS","TH","GA","HT","PA","CI","FR","RU","TR","NO","BZ","BJ","US","UG","EG","HU","KR","MZ","DK","AE","WS","MK","MN","IS","IT","LK","DO","ZA","XG"]]],"^1D",["^ ","^3","atom","^4",["NE.GDI.TOTL.CN","NE.GDI.TOTL.KD.ZG","NE.GDI.TOTL.KD","NE.GDI.TOTL.KN","NE.GDI.TOTL.ZS","NE.GDI.FTOT.CN","NE.GDI.FTOT.CD","NE.GDI.FTOT.KD.ZG","NE.GDI.FPRV.ZS"]],"^1?",["^ ","^3","atom","^4","Gross capital formation"],"^1E",["^ ","^3","atom","^4","2"],"^1=",["^ ","^3","atom","^4","Gross capital formation (formerly gross domestic investment) consists of outlays on additions to the fixed assets of the economy plus net changes in the level of inventories. Fixed assets include land improvements (fences, ditches, drains, and so on); plant, machinery, and equipment purchases; and the construction of roads, railways, and the like, including schools, offices, hospitals, private residential dwellings, and commercial and industrial buildings. Inventories are stocks of goods held by firms to meet temporary or unexpected fluctuations in production or sales, and \"work in progress.\" According to the 1993 SNA, net acquisitions of valuables are also considered capital formation. Data are in current U.S. dollars."],"^1@",["^ ","^3","atom","^4","World Bank national accounts data, and OECD National Accounts data files."],"^1F",["^ ","^3","atom"],"^1G",["^ ","^3","atom","^4",[["^ ","id","3","^4","Economy & Growth"]]],"^1H",["^ ","^3","atom","^4","dollar"]],"NE.CON.GOVT.CD",["^ ","^10",["^ ","^3","atom","^4","CC BY-4.0"],"^11",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^12",["^ ","^3","atom"],"^13",["^ ","^3","atom","^4",0],"^14",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^16","Gross domestic product (GDP) from the expenditure side is made up of household final consumption expenditure, general government final consumption expenditure, gross capital formation (private and public investment in fixed assets, changes in inventories, and net acquisitions of valuables), and net exports (exports minus imports) of goods and services. Such expenditures are recorded in purchaser prices and include net taxes on products.","^17","Gap-filled total","^18","Annual","^15","Economic Policy & Debt: National accounts: US$ at current prices: Expenditure on GDP","^1;","World Bank national accounts data, and OECD National Accounts data files.","^1<","General government final consumption expenditure (formerly general government consumption) includes all government current expenditures for purchases of goods and services (including compensation of employees). It also includes most expenditures on national defense and security, but excludes government military
